import { StatusBar } from 'expo-status-bar';
import React, {Component} from 'react';
import { ActivityIndicator, FlatList, StyleSheet, TouchableOpacity, Image, View } from 'react-native';

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  common: {
    paddingTop: 50
  },
  logo: {
    width: 300,
    height:  200
  },
  indicator: {
    paddingTop: 50
  }
});

// export default function App() {

