// }

export default class App extends Component {
  render () {
    const data = [
      {str: 'Rei Mizobuchi', key: 'boy'},
      {str: 'Nanami Tomatsu', key: 'girl'},
    ];

    return(
      <View style={styles.container}>
        <TouchableOpacity onPress={() => console.warn('pressed!')}>
          <Image style={styles.logo}source={require('./assets/react-native-logo.png')}/>
        </TouchableOpacity>
        <View style={styles.indicator}>
          <ActivityIndicator/>
        </View>
        <FlatList data={[{str: 'ReiMizobuchi', key: 'boy'},{str: 'NanamiTomatsu', key: 'girl'}]} renderItem={({item}) => {
          return(
            <Text>{item.str}</Text>
          )
        }}
        />
      </View>
    )
  }
}
